import React, { useState, useEffect } from "react";
import NewDeck from "./NewDeck";

function DeckList({ OnClick }) {
  //const [decks, setDecks] = useState({});

  const deckList = [<NewDeck />];

  function NewDeck({ OnClick }) {
    return (
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">Rendering in React</h5>
          <p>3 cards</p>
          <p className="card-text">
            React's component structure allows for quickly building a complex
            web application that relies on DOM manipulation.
          </p>

          <button
            to="/"
            className="btn btn-secondary"
            id="viewDeck"
            onClick={OnClick}
          >
            View
          </button>
          <button
            to="/"
            className="btn btn-primary"
            id="studyDeck"
            onClick={OnClick}
          >
            Study
          </button>

        </div>
      </div>
    );
  }

  const [testDecks, setTestDecks] = useState({});

  useEffect(() => {
    async function loadDecks() {
      const response = await fetch("http://localhost:5000/decks");
      const testDecksFromAPI = await response.json();
      setTestDecks(testDecksFromAPI);
    }
    loadDecks();
    console.log("test:", testDecks);
  }, []);

  return deckList;
}

export default DeckList;
